import * as React from "react";
import IWidget from "../interfaces/IWidget";
import { List, ListInlineItem } from 'reactstrap';

export function WidgetCard(props: IWidget) {
  const {
    name,
    username,
    email,
    address,
    phone,
    id,
    website,
    company
  } = props;
  return (
    // <div className="col-12 p-3">
