    //       <a href={phone} className="card-text font-italic">{phone}</a>
    //     </div>
    //   </div>
    // </div>
    <List type="inline">
    <ListInlineItem>{name}</ListInlineItem>
    <ListInlineItem><a href={email} className="card-text font-italic">{email}</a></ListInlineItem>
    <ListInlineItem><a href={phone} className="card-text font-italic">{phone}</a></ListInlineItem>
  </List>
  );
}
